import React from "react";

function ExpenseItem() {
  return (
    <div>
      <div>>March 28th 2021</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$294.56</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
